script: |
  super -f tsv -I q10230.sql | sort > q10230.out

inputs:
  - name: q10230.sql
    data: |
      SELECT CAST ( + 21 AS INTEGER ) + - - col1 + - - col0 * + col0 * col0 col1 FROM tab0 WHERE NOT + + col2 * - col2 BETWEEN - - col0 AND - col1 + + col2 GROUP BY col0, col1;
  - name: tab0

outputs:
  - name: q10230.out
    data: |
      17597
      571808
      79609
